import React from "react";
import './NewGoal.css'

const NewGoal = () => {
    const addGoalHandler = event => {
        event.preventDefault()
    }
    return (
        <form className="new-goal" onSubmit={addGoalHandler}>
            <imput type="text"></imput>
            <button type="submit">AddGoal</button>
        </form>
    )
}

export default NewGoal
